import React, { useEffect, useState } from 'react';
import { Phone, X } from 'lucide-react';
import useGlobalCallStore from '../services/GlobalCallService';
import { useTheme } from '../ThemeContext';

/**
 * Component to display available doctors that can be called from anywhere in the app
 */
const DoctorAvailabilityIndicator = () => {
  const { colors, isDarkMode } = useTheme();
  const [expanded, setExpanded] = useState(false);
  const [isLoading, setIsLoading] = useState(false);

  // Get data and functions from global call store
  const { 
    availableDoctors, 
    loadAvailableDoctors, 
    callDoctor,
    checkDoctorOnline
  } = useGlobalCallStore();

  // Track which doctors are online
  const [onlineDoctors, setOnlineDoctors] = useState({});

  // Load doctors on mount
  useEffect(() => {
    const fetchDoctors = async () => {
      setIsLoading(true);
      await loadAvailableDoctors();
      setIsLoading(false);
    };

    fetchDoctors();

    // Set up interval to refresh doctors
    const interval = setInterval(fetchDoctors, 30000);

    return () => clearInterval(interval);
  }, [loadAvailableDoctors]);

  // Check which doctors are online
  useEffect(() => {
    const checkOnlineStatus = async () => {
      const onlineStatuses = {};

      for (const doctor of availableDoctors) {
        onlineStatuses[doctor.id] = await checkDoctorOnline(doctor.id);
      }

      setOnlineDoctors(onlineStatuses);
    };

    if (availableDoctors.length > 0) {
      checkOnlineStatus();
    }

    // Set up interval to check online status
    const interval = setInterval(checkOnlineStatus, 15000);

    return () => clearInterval(interval);
  }, [availableDoctors, checkDoctorOnline]);

  // Calculate how many doctors are online
  const onlineDoctorCount = Object.values(onlineDoctors).filter(Boolean).length;

  // Only show doctors that are online according to the socket connection
  const filteredDoctors = availableDoctors.filter(doctor => onlineDoctors[doctor.id]);

  // If no doctors are online, return an empty fragment
  if (filteredDoctors.length === 0 && !isLoading) {
    return null;
  }

  return (
    <div 
      className={`fixed bottom-24 right-4 z-40 transition-all duration-500 ${
        expanded ? 'w-64' : 'w-auto'
      }`}
    >
      {/* Collapsed/expanded toggle */}
      <div 
        className={`flex items-center justify-between p-3 rounded-full shadow-lg cursor-pointer transition-all duration-300 ${
          expanded ? 'rounded-t-xl rounded-b-none mb-0' : 'mb-2'
        }`}
        style={{ 
          background: isDarkMode 
            ? `linear-gradient(135deg, ${colors.primary}, ${colors.primaryDark})` 
            : `linear-gradient(135deg, ${colors.primary}, ${colors.accent})`,
          boxShadow: `0 8px 20px -5px ${colors.primary}60`
        }}
        onClick={() => setExpanded(!expanded)}
      >
        <div className="flex items-center">
          <div className="w-4 h-4 rounded-full bg-green-400 animate-pulse mr-2"></div>
          <span className="text-white text-sm font-medium">
            {expanded ? 'Available Doctors' : `${onlineDoctorCount} Doctor${onlineDoctorCount !== 1 ? 's' : ''} Online`}
          </span>
        </div>
        {expanded && (
          <X size={16} color="white" className="ml-2" />
        )}
      </div>

      {/* Expanded doctor list */}
      {expanded && (
        <div 
          className="rounded-b-xl overflow-hidden shadow-lg transition-all duration-500 max-h-64 overflow-y-auto"
          style={{ 
            backgroundColor: isDarkMode ? colors.darkBg : 'white',
            boxShadow: `0 8px 20px -5px ${colors.primary}60`
          }}
        >
          {isLoading ? (
            <div className="p-4 flex items-center justify-center">
              <div className="w-5 h-5 border-2 border-blue-500 border-t-transparent rounded-full animate-spin mr-2"></div>
              <span className="text-sm" style={{ color: colors.textSecondary }}>Loading...</span>
            </div>
          ) : filteredDoctors.length === 0 ? (
            <div className="p-4 text-center">
              <span className="text-sm" style={{ color: colors.textSecondary }}>No doctors available</span>
            </div>
          ) : (
            <div className="divide-y" style={{ borderColor: `${colors.primary}20` }}>
              {filteredDoctors.map((doctor) => (
                <div 
                  key={doctor.id} 
                  className="p-3 flex items-center justify-between hover:bg-blue-50 transition-colors cursor-pointer dark-mode-transition"
                  style={{ 
                    backgroundColor: isDarkMode ? colors.cardBg : 'white',
                    ':hover': { backgroundColor: isDarkMode ? `${colors.primary}20` : 'rgba(239, 246, 255, 0.6)' }
                  }}
                  onClick={() => {
                    callDoctor(doctor);
                    setExpanded(false);
                  }}
                >
                  <div className="flex items-center">
                    <div className="w-8 h-8 rounded-full overflow-hidden mr-2">
                      <img 
                        src={doctor.image} 
                        alt={doctor.name} 
                        className="w-full h-full object-cover"
                      />
                    </div>
                    <div>
                      <div className="text-sm font-medium dark-mode-transition" style={{ color: colors.textPrimary }}>
                        {doctor.name}
                      </div>
                      <div className="text-xs dark-mode-transition" style={{ color: colors.textSecondary }}>
                        {doctor.specialty}
                      </div>
                    </div>
                  </div>
                  <button 
                    className="w-8 h-8 rounded-full flex items-center justify-center transition-transform hover:scale-110"
                    style={{ 
                      backgroundColor: colors.success,
                      boxShadow: `0 2px 8px -2px ${colors.success}60`
                    }}
                  >
                    <Phone size={14} color="white" />
                  </button>
                </div>
              ))}
            </div>
          )}
        </div>
      )}
    </div>
  );
};

export default DoctorAvailabilityIndicator;
